import { useState } from "react";
import { useNavigate } from 'react-router-dom';

// 選項數據：可以替換成實際的圖片URL
const options = [
    { value: '貓咪', imgSrc: 'data:image/jpeg;base64,' },
    { value: '帥貓咪', imgSrc: 'data:image/jpeg;base64,' },
    { value: '鯊魚', imgSrc: 'data:image/png;base64,' },
    { value: '恐龍', imgSrc: 'data:image/jpeg;base64,' },
    { value: '愛心', imgSrc: 'data:image/png;base64,' },
    { value: '皮卡丘', imgSrc: 'https://miro.medium.com/v2/resize:fit:630/1*MBb7iatu9etCcQQGxUXpbg.jpeg' },
];

export default function Creating() {
    const [searchQuery, setSearchQuery] = useState<string>('');
    const navigate = useNavigate();

    const handleSearch = () => {
        if (searchQuery.trim()) {
            // 將用戶重定向到指定的URL，並附加搜索查詢
            navigate(`/generate/creating/advanced?query=${ encodeURIComponent(searchQuery) }`);
            // window.location.href = `http://localhost:666/generate/creating/advanced?query=${encodeURIComponent(searchQuery)}`;
        } else {
            alert('請輸入搜索內容');
        }
    };

    // 處理選項圖片點擊事件
    const handleOptionClick = (value: string) => {
        setSearchQuery(value);
    };

    return (
        <>
            <div className="search-container">
                <input
                    type="text"
                    value={searchQuery}
                    onChange={(e) => setSearchQuery(e.target.value)}
                    placeholder="輸入搜索內容"
                    className="search-input"
                />
                <button onClick={handleSearch} className="search-button">搜索</button>
            </div>

            <div className="options-container">
                {options.map((option) => (
                    <div
                        key={option.value}
                        onClick={() => handleOptionClick(option.value)}
                    >
                        <img src={option.imgSrc} alt={option.value} />
                        <p>{option.value}</p>
                    </div>
                ))}
            </div>
        </>
    );
}
